$(document).ready(function(){$("#reg-form").submit(function(a){a.preventDefault();var b={first_name:$("input[name=first_name]").val(),last_name:$("input[name=last_name]").val(),user_name:$("input[name=user_name]").val(),facebook_name:$("input[name=facebook_name]").val(),linkedin_name:$("input[name=linkedin_name]").val(),email:$("input[name=email]").val(),password:$("input[name=password]").val()};$.ajax({type:"POST",url:"./",data:b,dataType:"json",encode:!0}).success(function(){console.log("SUCCESS!")}).fail(function(a){console.log("error: ",a)}).done(function(a){console.log("promise Done"),console.log("data: ",a)})})});